import React from "react";
import "./shopMenu.css";

const ShopMenu = () => {
  return (
    <div className="shop-menu">
      <select>
        <option value="" disabled selected>
          Select categories...
        </option>
        <option value="1">Bags</option>
        <option value="2">Accesories</option>
      </select>
    </div>
  );
};

export default ShopMenu;
